INSERT [dbo].[ProductType] ([ProductTypeID], [ProductTypeName], [Description]) VALUES (1, N'Competition', N'The Competition Series is Xtreme''s line designed for serious mountain riders who like to test the limits of mountain bike strength, versatility and responsiveness.  If this sounds familiar, then we''ve spent time developing, designing and testing these bikes just for you.  Many of these bikes are being used by top riders in the World Racing  series, in addition to our own team of elite racers.  Whatever you desire in a performance mountain bike, we can deliver with one our Competition bikes.')
GO
INSERT [dbo].[ProductType] ([ProductTypeID], [ProductTypeName], [Description]) VALUES (2, N'Hybrid', N'The Xtreme Hybrid Series of bicycles is a unique blend of off-road durability and necessary street performance.  Ideally suited for the commuter who needs a versatile and reliable bike which can withstand everyday wear and tear.  Xtreme Hybrids easily maneuver city streets plus are ready for any off-road conditions that arise.  With their comfortable geometry you can be sure you’re in for a smooth ride no matter what the terrain.')
GO
INSERT [dbo].[ProductType] ([ProductTypeID], [ProductTypeName], [Description]) VALUES (3, N'Mountain', N'The Mountain Series of Xtreme bikes are designed to handle assaults on both the mountains and the streets.  All bikes have 21 speed versatility, tested frame geometry and components that will enhance any off-road experience.  We''ve increased the strength and decreased the weight of the bikes by including more alloy components and testing all the frames with our in house racers.  This guarantees you low maintenance so you''ll spend the time putting miles on your bike rather than sitting around when it''s in the repair shop.')
GO
INSERT [dbo].[ProductType] ([ProductTypeID], [ProductTypeName], [Description]) VALUES (4, N'Kids', N'Xtreme has developed the Kids Series of mountain bikes for those who like the durability and quality of our adult bikes and want it available to the next generation of cyclists.  Our Kids Series follows the same guidelines and testing that we give our Mountain Series, so that you can be sure that your kids are in safe hands while giving their bike a tough workout.  The Xtreme Kids bike is up to the test and will pass with flying colors.')
GO
INSERT [dbo].[ProductType] ([ProductTypeID], [ProductTypeName], [Description]) VALUES (5, N'Gloves', N'Xtreme''s selection of cycling gloves covers the needs of all types of riders.  We have both lightweight  breathable lycra gloves and traditional crochet styles.  All our gloves have shock absorbing palm pads, either in gel or leather, and their durability is guaranteed for both hard pounding off-road or road riding.')
GO
INSERT [dbo].[ProductType] ([ProductTypeID], [ProductTypeName], [Description]) VALUES (6, N'Helmets', N'Protect your head with one of Xtreme''s helmets.  Choose from either Xtreme''s own line of adult and youth helmets or from our Triumph “racing” series.  All our helmets are fully approved by National Standards and are available in a variety of sizes and colors to suit your fancy.')
GO
INSERT [dbo].[ProductType] ([ProductTypeID], [ProductTypeName], [Description]) VALUES (7, N'Locks', N'Don’t let anyone get away with your bike! Choose from Xtreme''s wide selection of bike locks and feel secure that your bike''s future will remain in your own hands.   We have different types of  locks, from U locks to chain locks, that are available in a variety of sizes, from mini to maxi.  Choose and use any one of these locks and ensure the safety of your bicycle.')
GO
INSERT [dbo].[ProductType] ([ProductTypeID], [ProductTypeName], [Description]) VALUES (8, N'Saddles', N'Be it a men''s, ladies'', junior, or mini saddle that you need, Xtreme has it!  We have saddles designed especially for those extra rough and bumpy rides.  If it''s comfort and durability that you want, we can soon set you on the right seat.')
GO
SET IDENTITY_INSERT [dbo].[ProductType] OFF
GO
